Chair Pose (Utkatasana)

This standing pose works the muscles of the arms and legs, but it also stimulates the diaphragm and heart. In Chair pose, the ankles, thighs, calves, and spine are strengthened. The shoulders and chest are stretched. It can even reduce flat feet.

How to:

Begin standing at the top of your mat, feet slightly apart, arms down by your side, palms facing forward.

Inhale - raise your arms overhead, elbows beside your ears. Arms either parallel to each other with palms facing in or palms together.

Exhale - bend your knees, sit your hips back as if you were going to sit in a chair. Knees will shift over your feet and your torso will lean slightly forward over your thighs.

Shift your tailbone down toward the floor and remove any curve in your spine.
Chair Pose can be found in the second Sun Salutation sequence. To practice this pose independently, stay for 30 seconds to a minute. To help you stay in this pose, perform it near a wall. When you bend into the pose your tailbone should just touch and be supported by the wall.

