‚Å†
Simple, right? Maybe not, but that's why mindfulness is a practice. Over time, with the clarity of understanding how you are feeling, you can be deliberate in how you react and respond to events taking place.‚Å†
‚Å†
However, most of us live in the opposite state, without even realizing it. Our thoughts chatter like monkeys, frantically swinging from one to the next, keeping us from connecting with the stillness and truth that's always available to us just beneath the surface. ‚Å†
‚Å†
